import React from 'react'
import './App.css';
import { useState } from "react";
import TaskBox from './TaskBox.tsx';
import texts from "./texts.tsx";


const options: string[] = [];
texts.forEach((object) => !options.includes(object.answer) && options.push(object.answer));
console.log(options);

function App() {
  const [answers, setAnswers] = useState(null);
  return (
    <section>
      <article>
        <i className="material-symbols-outlined">cognition</i>
        <h1>Valitse oikea vastaus</h1>
        <p>Valitse alasvetovalikoista oikeat vastaukset ja sijoita ne oikeisiin kohtiin</p>
        <main>
          {texts.map((object, index) => <TaskBox id={object.id} options={options} key={`taskbox ${index}`}>{object.text}</TaskBox>)}
        </main>
      </article>
    </section>

  );
}

export default App;
